import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Define the XSS payload
    const xssPayload = "<script>alert('XSS')</script>";

    // Locate the search input field
    const searchInput = page.locator('#searchInput');
    await searchInput.waitFor({ state: 'visible' });

    // Fill the search input with the XSS payload
    await searchInput.fill(xssPayload);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_payload_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_payload_entered.png'));

    // Locate and click the search button to submit the payload
    const searchButton = page.locator('button.search-btn').first();
    await searchButton.click();

    // Wait for any potential navigation or DOM changes and take a final screenshot
    await page.waitForLoadState('domcontentloaded');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_submitted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_submitted.png'));

    return {
      success: true,
      action: "Attempted XSS via search input by entering a script payload and submitting the search.",
      extractedData: {
        payloadUsed: xssPayload
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to attempt XSS via search input.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
